    [],nt"revision_timestamp": "2016-08-30T12:25:13.267728",nt"name": "cooperative-recovery-initiative-arapaho-and-ul-bend-national-wildlife-refuges-black-footed",nt"isopen":
    false,nt"url": null,nt"notes": "White-tailed prairie dog colony mapping
    and density estimation willncontinue at Arapaho NWR through 2019, and a final report
    will be prepared at that time.  As of August 2016 a cumulative total of 4,000 acres
    (2,000 acres per year) of prairie dog colonies on Arapaho have been treated, 3,500
    acres less than anticipated in the 2014 CRI proposal due to an overestimation of
    occupied white-tailed prairie dog acreage in North Park by Colorado Parks and Wildlife
    staff in 2012.  At this time the amount of occupied prairie dog habitat (2,732 acres)
    at Arapaho NWR and adjoining Bureau of Land Management (BLM) lands is insufficient
    to support black-footed ferret reintroduction, but continued colony mapping in 2017-2019
    may change this finding.nnThe portion of this project implemented at UL Bend NWR
    is nearly complete, with final data collection for the expanded sylvatic plague
    vaccine (SPV) field trials occurring through the end of August 2016, the 4th year
    of SPV efficacy evaluations.  These data will help evaluate SPV efficacy in a broader
    study led by USGS and other collaborators.  CRI funds were also used to purchase
    manufacturing equipment and to help develop the ability to mass produce more than
    300,000 SPV  baits for treatments of more than 6,000 acres of prairie dogs in several
    western states.  CRI funds were also used to develop SPV bait dispensing abilities
    to enable realistic treatment of large areas of prairie dog with minimal time and
    expense, an effort that will continue into 2017.",nt"license_title": "License
